const Filter = ({ searchName, setSearchName }) => {

    const handleSearchName = (event) => {
        setSearchName(event.target.value)
    }
    return (
        <div>
            <form>
                <div>
                    filter shown with: <input value={searchName} onChange={handleSearchName} />
                </div>
            </form>
        </div>
    )
}

export default Fil
